import React from 'react';

import classes from './Button.module.css';

const Button = (props) => {
  return (
    <button
      type={props.type || 'button'}
      className={`${classes.button}`}
      //onClick={props.onClick}
      //disabled={props.disabled}
    >
      {props.children}
    </button>
  );
};

export default Button;
